import React, { useRef, useEffect } from "react";

const Marquee = (props) => {
  return (
    <marquee behavior="" direction={props.dir}>
      <div style={{ display: "flex" }}>
        {new Array(8).fill(2).map((data, i) => (
          <div style={{ width: "80px", aspectRatio: "1/1" }}>{i}</div>
        ))}
      </div>
    </marquee>
  );
};

export default Marquee;
